import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
      name: '',
      upc: '',
      availableOn: '',
      inputs: []
    };
  }
  render(){
  return (
        <div style={{marginLeft:40, marginTop:40}}>
          <form>
            <label>
              CUI:
              <input type="text" name="name" maxLength={9}/>
            </label>
            <input type="submit" value="Submit" />
          </form>
        </div>
  );
}
}

export default App;
